import React,{useState} from 'react';



const Collections = () => {
    const collectionList = [
        {
            name:"Africozy",
            image:"https://cdn.shopify.com/s/files/1/0744/3968/8473/collections/Hoodies.jpg?v=1681635498&width=535"
        },
        {
            name:"AfriGifts",
            image:"https://cdn.shopify.com/s/files/1/0744/3968/8473/collections/Untitled_design_34.png?v=1681591493&width=535"
        },
        {
            name:"Afritees",
            image:"https://cdn.shopify.com/s/files/1/0744/3968/8473/collections/TEes.jpg?v=1682099247&width=535"
        }
    ]

    const footerList = [
        {
            name:"Powered by Shopify"
        },
        {
            name:"Refund policy"
        },
        {
            name:"Terms of service"
        },
        {
            name:"Shipping Policy"
        }
    ]
    return(
        <div>
            <div
                style={{
                    position:"relative",
                    fontSize:"3vw",
                    fontWeight:"bold",
                    right:"37vw",
                    bottom:"30vh",
                    marginBottom:"1vh",
                }}
                >
                        Collections
                    </div>
            {
                collectionList.map((item,i) => (
                    <div
                        style={{
                            position:"relative",
                            float:"left",
                            width:"30vw",
                            marginLeft:"1vw",
                            left:"5vw",
                            height:"50vh",
                            bottom:"20vh",
                            backgroundImage:`url(${item.image})`,
                            backgroundRepeat:"no-repeat",
                            backgroundPosition:"center"
                        }}
                    >

                        <div style={{
                            position:"relative",
                            top:"50vh"
                        }}>
                            {item.name}
                        </div>
                    </div>
                ))
            }

            <div
                style={{
                    position:"relative",
                    fontSize:"2vw",
                    top:"2vh",
                    left:"5vw",
                    height:"70vh",
                    width:"20vw"
                }}
            >
                        Subsribe to our emails
                        <div>
                            <input style={{position:"relative",width:"20vw",height:"5vh"}} type='text' />
                        </div>

                        <div
                            style={{
                                position:"relative",
                                fontSize:"1vw",
                                bottom:"10vh",
                                left:"70vw",
                                backgroundColor:"#7F68E9",
                                height:"10vh",
                                borderRadius:"8vw"
                            }}
                        >
                            <img style={{
                                position:"relative",
                                top:"3vh",
                                right:"5vw",
                                height:"4vh",
                                width:"2vw"
                            }} src={"https://external-content.duckduckgo.com/iu/?u=http%3A%2F%2Fsguru.org%2Fwp-content%2Fuploads%2F2018%2F01%2Flogo-app-pictures-photo-network-instagram-social-icon.png&f=1&nofb=1&ipt=47097cc086026cd92e5a6329804b83c7fce47bf287d08e4b44094daae7c39f39&ipo=images"} />
                            <div style={{
                                position:"relative",
                                bottom:"0.5vh",
                                color:"white",
                                fontWeight:"800"
                            }}>
                                Follow shop
                            </div>
                        </div>
                    <hr style={{
                        position:"relative",
                        bottom:"8vh",
                        width:"90vw",
                        height:"0vw"
                    }} />
                <div
                    style={{
                        position:"relative",

                        fontSize:"1vw",
                        width:"100vw",
                        bottom:"5vh",
                        right:"18vw",
                    }}
                >
                    {footerList.map((item,i) => (
                        <div style={{
                            position:"relative",
                            float:"left"
                        }}>
                            {item.name}
                        </div>
                    ))}

                </div>
            </div>
        </div>
    )

}
const Landing = () => {
    const [active, setActive] = useState("white")
    const [currentTab, setCurrentTab] = useState('Home')
    const tabList = [ 
        {
            name: 'Home',
            label:'Home',
            content:(
                <div style={{
                    position:"relative",
                    top:"40vh"
                }}>

                    <Collections />

                </div>
            )
        },
        { 
            name: 'Collections',
            label:'Collections',
            content:(
                <div
                    style={{
                    position:"relative",
                    top:"40vh"
                    }}
                >
                    PING PING
                </div>
            )
        },
        { 
            name: 'Everything and Afrithings',
            label:'Everything and Afrithings',
            content:(
                <div
                    style={{
                        position:"relative",
                        top:"40vh"
                    }}
                >
                    Hello
                </div>
            )
        },
        { 
            name: 'Refunds & returns',
            label:'Refunds & returns',
            content:(
                <div
                    style={{
                        position:"relative",
                        top:"40vh"
                    }}
                >
                    Ping ping
                </div>
            )
        },
        { 
            name: 'About us',
            label:'About us',
            content:(
                <div style={{
                    position:"relative",
                    top:"40vh"
                }}>
                    HELLO
                </div>
            )
        },
    ]
    let imageLink = "https://cdn.shopify.com/s/files/1/0744/3968/8473/files/White_Logo.png?v=1681576513&width=120"
    return(
<div>
    <div
        style={{
            position:"relative",
            top:"2vh",
            backgroundColor:"black",
            backgroundImage:`url(${imageLink})`,
            backgroundRepeat:"no-repeat",
            backgroundPosition:"center bottom",
            width:"100%",
            height:"20vh"
        }}
        >
    {
        tabList.map((tab, i) => (
                <button 
                variant="outlined"
                key={i}
                onClick={() => setCurrentTab(tab.name)}
                style={{
                    position:"relative",
                    textTransform:"none",
                    height:"3vh",
                    top:"7vh",
                    borderRadius:"2px",
                    display:"flex",
                    color:active === i ? "white" :"black",
                    background:"white",
                    marginLeft:"11vw",
                    float:"left"
                }}>
                    {tab.label}
                </button>

            ))
        }
    </div>
    {
        tabList.map((tab, i) => {
            if(tab.name === currentTab){
                return <div key={i}> {tab.content} </div>
            }else return
        })
    }
</div>
    )
}
export default Landing;
